import React, { useEffect, useState } from "react";
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from "recharts";

const SensorGraphs = () => {
  const [sensorData, setSensorData] = useState([]);
  const [timeTaken, setTimeTaken] = useState(0); 

  const fetchSensorData = async () => {
    try {
      const response = await fetch("http://localhost:4000/api/sensor-data");
      const data = await response.json();
      setSensorData(
        data.map(entry => ({
          ...entry,
          timestamp: new Date(entry.timestamp).toLocaleTimeString(), // Format time
        }))
      );
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {
    fetchSensorData(); // Fetch initially
    const interval = setInterval(fetchSensorData, 2000); // Refresh every 2 seconds

    return () => clearInterval(interval); // Cleanup on unmount
  }, []);

  return (
    <div>
          {/* Box to display time taken in seconds */}

      <div style={{ marginTop: '20px', padding: '10px', border: '1px solid #ccc', borderRadius: '5px', backgroundColor: '#f9f9f9' }}>

<h3>Time Taken: {timeTaken.toFixed(2)} seconds</h3> {/* Display time taken in seconds with 2 decimal places */}

</div>
      <h2>Color Sensor Data(RGB)</h2>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart data={sensorData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="timestamp" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="RGB.red" stroke="red" />
          <Line type="monotone" dataKey="RGB.green" stroke="green" />
          <Line type="monotone" dataKey="RGB.blue" stroke="blue" />
        </LineChart>
      </ResponsiveContainer>

      <h2>Photodiode Sensor (Light Intensity)</h2>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart data={sensorData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="timestamp" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="lightIntensity" stroke="orange" />
        </LineChart>
      </ResponsiveContainer>

      <h2>Combined Sensor Data</h2>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart data={sensorData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="timestamp" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="RGB.red" stroke="red" />
          <Line type="monotone" dataKey="RGB.green" stroke="green" />
          <Line type="monotone" dataKey="RGB.blue" stroke="blue" />
          <Line type="monotone" dataKey="lightIntensity" stroke="orange" />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
};

export default SensorGraphs;
